The static priority of each handler can be declared in the task attribute using the priority argument. For Cortex-M, tasks can have priorities in the range 1..=(1 << NVIC_PRIO_BITS) where NVIC_PRIO_BITS is a constant defined in the device crate. When the priority argument is omitted, the priority is assumed to be 1. The idle task has a non-configurable static priority of 0, the lowest priority. A higher number means a higher priority in RTIC, which is the opposite from what Cortex-M does in the NVIC peripheral. Explicitly, this means that number 10 has a higher priority than number 9. When several tasks are ready to be executed the one with highest static priority will be executed first. Task prioritization can be observed in the following scenario: during the execution of a low priority task a higher priority task is spawned; this puts the higher priority task in the pending state. The difference in priority results in the higher priority task preempting the lower priority one: the execution of the lower priority task is suspended and the higher priority task is executed to completion. Once the higher priority task has terminated the lower priority task is resumed. The following example showcases the priority based scheduling of tasks. //! examples/preempt.rs #![no_main]
#![no_std] use panic_semihosting as _;
use rtic::app; #[app(device = lm3s6965, dispatchers = [SSI0, QEI0])]
mod app { use cortex_m_semihosting::{debug, hprintln}; #[shared] struct Shared {} #[local] struct Local {} #[init] fn init(_: init::Context) -> (Shared, Local, init::Monotonics) { foo::spawn().unwrap(); (Shared {}, Local {}, init::Monotonics()) } #[task(priority = 1)] fn foo(_: foo::Context) { hprintln!("foo - start").unwrap(); baz::spawn().unwrap(); hprintln!("foo - end").unwrap(); debug::exit(debug::EXIT_SUCCESS); // Exit QEMU simulator } #[task(priority = 2)] fn bar(_: bar::Context) { hprintln!(" bar").unwrap(); } #[task(priority = 2)] fn baz(_: baz::Context) { hprintln!(" baz - start").unwrap(); bar::spawn().unwrap(); hprintln!(" baz - end").unwrap(); }
} $ cargo run --target thumbv7m-none-eabi --example preempt
foo - start baz - start baz - end bar
foo - end Note that the task bar does not preempt task baz because its priority is the same as baz's. However, once baz returns, the execution of task bar is prioritized over foo due to its higher priority. foo is resumed only after bar returns. One more note about priorities: choosing a priority higher than what the device supports will result in a compile error. Due to limitations in the language, the error message is currently far from helpful: it will say something along the lines of "evaluation of constant value failed" and the span of the error will not point out to the problematic interrupt value -- we are sorry about this!

